import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Table from 'react-bootstrap/Table';
function App() {
  let Todo = ["charger", "power bank", "bedsheet", "mobile phone"]
  return (
    <div className="App " striped bordered hover >
      <Table></Table>
      <tr>
        <th>Order</th>
        <th>Value</th>
      </tr>
      {Todo.map((t,i) => <tr>
        <td>{i+1}</td>
        <td>{t}</td>
      </tr>)}
    </div>
  );
}
export default App;
